package inClass;

public class TableNum {

	/**
	 * @param args
	 */
	
	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int n;
		for(int i=1; i<=10;i++)
		{
			for(int j=1;j<=10;j++)
			{
				n=i*j;
				System.out.println(+i+"*"+j+"="+n);
			}
	//System.out.println();
		}

	}

}
